import React from "react";
import './home.css'
import 'bootstrap/dist/css/bootstrap.css';
import { auth } from "./firebase";
import { BsPlusSquare } from "react-icons/bs";
import { useNavigate } from "react-router-dom";

function Home() {
    const navigate = useNavigate();
    const handleaddpost = () => {
        navigate('/Addpost');
    }

    return ( 
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
            <div className="container">
            <a href="/" className="navbar-brand fw-bolder" >instagram</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse"  data-target ="#mynavbar"
            aria-controls="mynavbar" aria-label="Toggle navigation" aria-expanded="false">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse " id="mynavbar"> 
            <ul className="navbar-nav ms-auto">
                <li className="nav-item"><a href="/" className="nav-link">Home</a></li>
                <li className="nav-item"><a href="/" className="nav-link"><BsPlusSquare size={18} onClick={handleaddpost}></BsPlusSquare>
                </a></li>
            </ul>
            </div>
            </div>
            </nav>
            <img className="logo" src={auth.currentUser?.photoURL || ""} alt="user" ></img>
            
        </div>
        
     );
}

export default Home;
